import React from "react";

const ProductCard = ({ nombre, descripcion, precio, marca, modelo, año }) => {
  return (
    <div className=" w-full">
      <div className=" flex  ml-24">
        <h2 className=" text-4xl font-[Bebas Neue]">{marca.toUpperCase()}</h2>
      </div>
      <div className=" flex ml-24">
        <h1 className=" text-5xl font-semibold font-[Helvetica Neue]">
          {nombre}
        </h1>
      </div>
    </div>
  );
};

export default ProductCard;
